    false,nt"url": null,nt"notes": "In response to significant morphologic
    changes in Okmok Caldera due to the phreatomagmatic eruption of Okmok volcano in
    2009, a new digital elevation model was acquired to document and quantitatively
    assess the new volcanic features and altered hydrology within the caldera. This
    DEM dataset provides elevation data derived from a stereo pair of Worldview-1 satellite
    images acquired on January 21, 2010. In addition to the DEM, a shaded-relief image
    is also provided for easy visualization of the data.",nt"license_title": null,nt"extras":
